import React from 'react'
import styled from 'styled-components'

const Tree_styled = styled.div`
    border: white;
    border-radius: 25%;
    width: 100%;
    height: 100%;
`

const tree = (props) => {
    return (
        <Tree_styled>
            {props.children}
        </Tree_styled>
    )
}  
export default tree
